import React, { useState } from 'react';
import { Container, Typography, Box, Button, Dialog, DialogTitle, DialogContent, IconButton } from '@mui/material';
import CloseIcon from '@mui/icons-material/Close';

const LocationPage = () => {
  const [open, setOpen] = useState(false);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  return (
    <Container>
      <Box mt={4}>
        <Typography variant="h2">Our Location</Typography>
        <Typography variant="h5" mt={2}>
          123 Nail Street, Closter, NY 12345
        </Typography>
        <Button variant="contained" color="primary" onClick={handleClickOpen} mt={2}>
          View Map
        </Button>
      </Box>

      {/* Map Modal */}
      <Dialog open={open} onClose={handleClose} fullWidth maxWidth="md">
        <DialogTitle>
          Location Map
          <IconButton
            edge="end"
            color="inherit"
            onClick={handleClose}
            aria-label="close"
            sx={{ position: 'absolute', right: 8, top: 8 }}
          >
            <CloseIcon />
          </IconButton>
        </DialogTitle>
        <DialogContent>
          <iframe
            title="Google Maps"
            src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3012.465026703997!2d-73.96257658822523!3d40.97129702158144!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x89c2ee41d31828d1%3A0xf5a1defefb201ccc!2s12%20Perry%20St%2C%20Closter%2C%20NJ%2007624!5e0!3m2!1sen!2sus!4v1724280258415!5m2!1sen!2sus"
            width="100%"
            height="400"
            style={{ border: 0 }}
            allowFullScreen=""
            loading="lazy"
          />
        </DialogContent>
      </Dialog>
    </Container>
  );
};

export default LocationPage;
